import React from "react"
import {Button, ButtonGroup, Card, Col, Container, Row } from "react-bootstrap"
import Carusel1 from "./StyledComponent/CaruselStart"
import '../Styles/style.css'
import f1 from '../Styles/img/f4.jpg'
import f5 from '../Styles/img/f5.jpg'
import Cards from "./StyledComponent/Cards"
export default function StartPage(){

  return(

      <div className = 'mainContainer'>

        <div className = "introSection">

          <div className = "text8">
            <h1>Работайте в команде</h1>
            Управляйте проектами и выводите продуктивность на новый уровень собственным уникальным способом вместе с startUp!.
            </div>

            <div className = 'form'>

              <Button variant="outline-primary" size = "">Signin</Button>
            </div>

          <img className = "timeimg" src = {f5}/> 

        </div>

      </div>


  )
}
